        JexlEngine engine = new JexlEngine();

        // Step 1: Submit a script containing a synchronized block with a statement terminator
        JexlScript scriptWithSyncTerminator = engine.createScript("synchronized { 2 + 3; }");

        // Step 2: Execute the script
        Object syncTerminatorResult = scriptWithSyncTerminator.execute(null);

        // Step 3: Verify the calculation produces the expected numeric result
        assertThat(syncTerminatorResult).isEqualTo(5);

        // Step 17: Submit a script containing a map literal accessed by key
        JexlScript scriptMapLiteral = engine.createScript("{\"key\": \"value\"}.key");

        // Step 18: Execute the script
        Object mapLiteralResult = scriptMapLiteral.execute(null);

        // Step 19: Ensure direct value retrieval works correctly
        assertThat(mapLiteralResult).isEqualTo("value");

        // Step 20: Submit a script containing a simple assignment block
        JexlScript scriptAssignmentBlock = engine.createScript("x = 42");

        // Step 21: Execute the script
        Object assignmentBlockResult = scriptAssignmentBlock.execute(null);

        // Step 22: Confirm the assigned value is returned
        assertThat(assignmentBlockResult).isEqualTo(42);

        // Step 35: Submit a script containing an expression-only block with a terminator
        JexlScript scriptExpressionTerminator = engine.createScript("2 + 3;");

        // Step 36: Execute the script
