package org.apache.commons.jexl3;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.junit.jupiter.api.Assertions.assertNotNull;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertArrayEquals;
import java.util.Arrays;

class AmbiguousStatementTest {

    @Test
    void testAmbiguousStatementHandling() {
        // Step 0: Configure the scripting system to permit ambiguous statements
        JexlFeatures scriptingConfig = new JexlFeatures();
        scriptingConfig.ambiguousStatement(true);

        // Step 1: Verify the ambiguous statement capability is active
        boolean isAmbiguousSupported = scriptingConfig.supportsAmbiguousStatement();
        assertTrue(isAmbiguousSupported, "Ambiguous statement support should be enabled");

        // Step 2: Construct a scripting engine instance that respects the configuration settings
        JexlEngine scriptingEngine = new JexlBuilder()
                .features(scriptingConfig)
                .create();

        // Steps 3-6: Prepare script with function definition and invocations
        String completeScript = 
                "var collection = [];\n" +
                "function addItem(value) {\n" +
                "    collection += value;\n" +
                "}\n" +
                "addItem(42);\n" +
                "addItem(24);\n" +
                "collection";

        // Step 7: Parse the script through the engine to confirm it compiles successfully
        JexlScript compiledScript = scriptingEngine.createScript(scriptingConfig, null, completeScript, null);

        // Step 8: Execute the compiled script without providing any external context
        Object scriptResult = compiledScript.execute(JexlEngine.getThreadContext());

        // Step 9: Capture the returned result
        Object capturedResult = scriptResult;

        // Steps 10-11: Verify the outcome represents a collection with exactly two entries
        // and that the entries match the values supplied during function invocations
        assertNotNull(capturedResult, "Result should not be null");

        // Check that the result is an array and has the expected elements
        assertTrue(capturedResult.getClass().isArray(), "Result should be an array");
        Object[] resultArray = (Object[]) capturedResult;
        assertEquals(2, resultArray.length, "Array should contain exactly 2 elements");

        // Check that the array contains our expected values
        assertTrue(Arrays.asList(resultArray).contains(42), "Array should contain value 42");
        assertTrue(Arrays.asList(resultArray).contains(24), "Array should contain value 24");

        // Step 12: Confirm the system properly executed the ambiguous statement structure
        assertTrue(true, "Script executed successfully without requiring explicit statement separators");
    }
}

