public class AmbiguousStatementTest {

    @Test
    public void testAmbiguousStatementFeature() {
        // Step 0: Construct a JexlFeatures instance using the default feature set
        JexlFeatures defaultFeatures = JexlFeatures.createDefault();

        // Step 1: Invoke the configuration method to enable ambiguous statement support, passing a boolean true value
        JexlFeatures configuredFeatures = defaultFeatures.ambiguousStatement(true);

        // Step 2: Verify that ambiguous statement support is active immediately after enabling it
        assertTrue(configuredFeatures.supportsAmbiguousStatement(), "Ambiguous statement support should be active immediately after enabling");

        // Step 3: Instantiate a JexlBuilder
        JexlBuilder builder = new JexlBuilder();

        // Step 4: Apply the features configuration to the builder
        JexlBuilder configuredBuilder = builder.features(configuredFeatures);

        // Step 5: Get the features from the builder to verify they were properly set
        JexlFeatures builderFeatures = configuredBuilder.features();

        // Step 6: Verify that ambiguous statement support is still active after applying to builder
        assertTrue(builderFeatures.supportsAmbiguousStatement(), "Ambiguous statement support should still be active after applying to builder");

        // Step 7: Invoke the creation method to produce a JexlEngine instance
        JexlEngine engine = configuredBuilder.create();

        // Step 8: Construct a source string representing a JEXL script
        String sourceString = "var x = []; function f(const y) { x.push(y) }; f(1); f(2); return x";

        // Step 9: Invoke the script creation method with the source string to produce a JexlScript instance
        JexlScript script = engine.createScript(sourceString);

        // Step 10: Execute the script by invoking its execution method with a null context
