package org.apache.commons.jexl3;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class SqlStyleOperatorsTest {

    @Test
    public void testSqlStyleComparisonOperators() {
        // Setup steps 0-5: Configure system with restricted features and create engine
        JexlFeatures restrictedFeatures = new JexlFeatures()
            .localVar(false)
            .lambda(false)
            .loops(false)
            .sideEffect(false)
            .sideEffectGlobal(false);

        JexlEngine evaluationEngine = new JexlBuilder()
            .cache(32)
            .features(restrictedFeatures)
            .create();

        // Step 6: Prepare inequality expression checking whether parameter differs from 25
        JexlExpression inequalityExpression = evaluationEngine.createExpression("x != 25");

        // Step 7: Execute inequality expression with input 24
        MapContext context1 = new MapContext();
        context1.set("x", 24);
        Object inequalityResult1 = inequalityExpression.evaluate(context1);

        // Step 8: Verify system returns true for inequality with input 24
        assertEquals(true, inequalityResult1, "Inequality check with 24 should return true");

        // Step 10: Execute inequality expression with input 25
        MapContext context2 = new MapContext();
        context2.set("x", 25);
        Object inequalityResult2 = inequalityExpression.evaluate(context2);

        // Step 11: Verify system returns false for inequality with input 25
        assertEquals(false, inequalityResult2, "Inequality check with 25 should return false");

        // Step 12: Prepare equality expression checking whether parameter equals 25
        JexlExpression equalityExpression = evaluationEngine.createExpression("x == 25");

        // Step 13: Execute equality expression with input 24
        MapContext context3 = new MapContext();
        context3.set("x", 24);
        Object equalityResult1 = equalityExpression.evaluate(context3);

        // Step 14: Verify system returns false for equality with input 24
        assertEquals(false, equalityResult1, "Equality check with 24 should return false");

        // Step 15: Prepare not-equal expression using exclamation mark operator
        JexlExpression notEqualExpression = evaluationEngine.createExpression("x != 25");

        // Step 16: Execute not-equal expression with input 24
        MapContext context4 = new MapContext();
        context4.set("x", 24);
        Object notEqualResult1 = notEqualExpression.evaluate(context4);

        // Step 17: Verify system returns true for not-equal with input 24
        assertEquals(true, notEqualResult1, "Not-equal check with 24 should return true");

        // Step 19: Execute equality expression with input 25
        MapContext context5 = new MapContext();
        context5.set("x", 25);
        Object equalityResult2 = equalityExpression.evaluate(context5);

        // Step 20: Verify system returns true for equality with input 25
        assertEquals(true, equalityResult2, "Equality check with 25 should return true");

        // Step 22: Execute not-equal expression with input 25
        MapContext context6 = new MapContext();
        context6.set("x", 25);
        Object notEqualResult2 = notEqualExpression.evaluate(context6);

        // Step 23: Verify system returns false for not-equal with input 25
        assertEquals(false, notEqualResult2, "Not-equal check with 25 should return false");
    }
}

