        JexlEngine engine = new JexlBuilder().create();

        // Step 1: Configure the system with a restrictive security policy that blocks access to system classes
        JexlSandbox restrictiveSandbox = new JexlSandbox(false);
        restrictiveSandbox.block("java.lang.System");
        engine = new JexlBuilder().sandbox(restrictiveSandbox).create();

        // Step 2: Attempt to execute an expression that accesses a blocked system class
        JexlExpression expression = engine.createExpression("System.currentTimeMillis()");

