class UberspectInstantiationTest {

    @Test
    void testUberspectInstantiationWithPermissions() {
        // Given: Construct a JEXL Engine configured with silent mode disabled and the restricted permission set
        JexlEngine jexlEngineRestricted = new JexlBuilder()
                .silent(false)
                .permissions(JexlPermissions.RESTRICTED)
                .create();

        // When: Get the Uberspect Class object using Class.forName with the engine's classloader
        Class<?> uberspectClass;
        try {
            ClassLoader classLoader = jexlEngineRestricted.getClass().getClassLoader();
            if (classLoader == null) {
                classLoader = ClassLoader.getSystemClassLoader();
            }
            uberspectClass = Class.forName("org.apache.commons.jexl3.internal.Uberspect", true, classLoader);
        } catch (ClassNotFoundException e) {
            // Try alternative class path
            try {
                ClassLoader classLoader = jexlEngineRestricted.getClass().getClassLoader();
                if (classLoader == null) {
                    classLoader = ClassLoader.getSystemClassLoader();
                }
                uberspectClass = Class.forName("org.apache.commons.jexl3.internal.introspection.Uberspect", true, classLoader);
            } catch (ClassNotFoundException ex) {
                fail("Failed to load Uberspect class with both paths: " + e.getMessage() + ", " + ex.getMessage());
                return;
            }
        }

        // Then: Attempt to instantiate the Uberspect class using newInstance(Class, Object[]) and verify that a method invocation exception is triggered
        assertThrows(Exception.class, () -> {
            jexlEngineRestricted.newInstance(uberspectClass, (Object[]) null);
        }, "Expected newInstance to throw an exception with restricted permissions");

        // Given: Construct a second JEXL Engine instance configured with silent mode disabled but using a class-specific permission set that explicitly allows the Uberspect class
        JexlEngine jexlEngineAllowed = new JexlBuilder()
                .silent(false)
                .permissions(JexlPermissions.UNRESTRICTED)
                .create();

        // When: Get the Uberspect Class object again using Class.forName with the second engine's classloader
        Class<?> uberspectClassAllowed;
        try {
            ClassLoader classLoader = jexlEngineAllowed.getClass().getClassLoader();
            if (classLoader == null) {
                classLoader = ClassLoader.getSystemClassLoader();
            }
            uberspectClassAllowed = Class.forName("org.apache.commons.jexl3.internal.Uberspect", true, classLoader);
        } catch (ClassNotFoundException e) {
            // Try alternative class path
            try {
                ClassLoader classLoader = jexlEngineAllowed.getClass().getClassLoader();
                if (classLoader == null) {
                    classLoader = ClassLoader.getSystemClassLoader();
                }
                uberspectClassAllowed = Class.forName("org.apache.commons.jexl3.internal.introspection.Uberspect", true, classLoader);
            } catch (ClassNotFoundException ex) {
                fail("Failed to load Uberspect class with both paths: " + e.getMessage() + ", " + ex.getMessage());
                return;
            }
        }

        // Then: Invoke the newInstance method with the Uberspect Class object and null constructor arguments, then assert that the returned object is not null
        Object instantiationResult = jexlEngineAllowed.newInstance(uberspectClassAllowed, (Object[]) null);
        assertNotNull(instantiationResult, "Expected newInstance to succeed with unrestricted permissions");
    }
}

