        JexlContext jexlContext = new MapContext();

        // Step 2: Compose a restricted permissions instance that explicitly allows the getSimpleName method on the Class type
        JexlPermissions restrictedPermissions = JexlPermissions.RESTRICTED.compose(new String[]{"java.lang.Class.getSimpleName"});

        // Step 3: Instantiate a sandbox configured to disallow reading and writing but allow execution on Object class
        // while explicitly permitting the toString method execution on String class
        JexlSandbox configuredSandbox = new JexlSandbox(false);
        configuredSandbox.permissions("java.lang.Object", false, false, true, false);
        configuredSandbox.permissions("java.lang.String", false, false, false, true).method("toString", true);

        // Step 4: Configure a new JEXL engine through the builder with safe mode disabled, silent mode disabled,
        // the composed permissions, and the configured sandbox
        JexlEngine restrictedEngine = new JexlBuilder()
                .safe(false)
                .silent(false)
                .permissions(restrictedPermissions)
                .sandbox(configuredSandbox)
                .create();

        // Step 5: Create a string parameter for script testing
        String stringParameter = "testString";

        // Step 6: Create and execute a script with the string parameter using the restricted engine
        JexlScript toStringScript = restrictedEngine.createScript("x.toString()");
        jexlContext.set("x", stringParameter);
        Object toStringResult = toStringScript.execute(jexlContext, stringParameter);

        // Step 7: Assert the result matches the input
        assertEquals(stringParameter, toStringResult);

        // Step 8: Prepare a script calling getClass on a string parameter
        JexlScript getClassScript = restrictedEngine.createScript("x.getClass()");

