        // Step 14: Prepare a script that accesses the simpleName property through the class property chain on an Object instance
        JexlScript getSimpleNameScript = restrictedEngine.createScript("x.class.simpleName");

        // Step 15: Execute the getSimpleName script using the restricted engine
