        JexlFeatures features = new JexlFeatures();
        features.ambiguousStatement(true);

        JexlBuilder builder = new JexlBuilder();
        builder.features(features);

        // Step 1: Disable safe navigation in the system configuration
        builder.safe(false);

        // Step 2: Enforce strict evaluation rules in the system configuration
        builder.strict(true);
        JexlEngine engine = builder.create();

        // Step 3-6: Prepare a switch expression that assigns a variable based on an input parameter
        // Using correct JEXL syntax for switch expressions
        String validSwitchExpression = "switch(x) { case 10: case 11: 3; case 20: case 21: 4; default: x + 4 }";

        // Step 7: Parse the valid switch expression into an executable form
        JexlExpression parsedExpression = engine.createExpression(validSwitchExpression);

        // Step 8: Confirm the system can retrieve the textual representation of the parsed expression
        String expressionText = parsedExpression.getSourceText();
        assertNotNull(expressionText);
        assertFalse(expressionText.isEmpty());

        // Step 9: Prepare input value ten for expression execution
        int inputTen = 10;

        // Step 10: Execute the parsed expression with input ten
        MapContext contextWithInputTen = new MapContext();
        contextWithInputTen.set("x", inputTen);
        Object resultTen = parsedExpression.evaluate(contextWithInputTen);

        // Step 11: Verify the outcome equals three
        assertEquals(3, resultTen);

        // Step 12: Prepare input value eleven for expression execution
        int inputEleven = 11;

        // Step 13: Execute the parsed expression with input eleven
        MapContext contextWithInputEleven = new MapContext();
        contextWithInputEleven.set("x", inputEleven);
        Object resultEleven = parsedExpression.evaluate(contextWithInputEleven);

        // Step 14: Verify the outcome equals three
        assertEquals(3, resultEleven);

        // Step 15: Prepare input value twenty for expression execution
        int inputTwenty = 20;

        // Step 16: Execute the parsed expression with input twenty
        MapContext contextWithInputTwenty = new MapContext();
        contextWithInputTwenty.set("x", inputTwenty);
        Object resultTwenty = parsedExpression.evaluate(contextWithInputTwenty);

        // Step 17: Verify the outcome equals four
        assertEquals(4, resultTwenty);

        // Step 18: Prepare input value twenty-one for expression execution
        int inputTwentyOne = 21;

        // Step 19: Execute the parsed expression with input twenty-one
        MapContext contextWithInputTwentyOne = new MapContext();
        contextWithInputTwentyOne.set("x", inputTwentyOne);
        Object resultTwentyOne = parsedExpression.evaluate(contextWithInputTwentyOne);

        // Step 20: Verify the outcome equals four
        assertEquals(4, resultTwentyOne);

        // Step 21: Prepare input value thirty-eight for expression execution
        int inputThirtyEight = 38;

        // Step 22: Execute the parsed expression with input thirty-eight
        MapContext contextWithInputThirtyEight = new MapContext();
        contextWithInputThirtyEight.set("x", inputThirtyEight);
        Object resultThirtyEight = parsedExpression.evaluate(contextWithInputThirtyEight);

        // Step 23: Verify the default branch produces forty-two by computing four plus the input value
        assertEquals(42, resultThirtyEight);

        // Step 24: Prepare a second switch expression that attempts to use a break statement within a case branch returning no value
        String invalidSwitchExpression = "switch(x) { case 10: break; default: 0 }";

        // Step 25: Attempt to parse the invalid switch expression
        JexlException parsingError = assertThrows(JexlException.class, () -> {
            engine.createExpression(invalidSwitchExpression);
        });

        // Step 27: Confirm the error message explicitly references the prohibited break keyword
        assertTrue(parsingError.getMessage().contains("break"));
    }
}

