public class SwitchExpressionTest {

    @Test
    public void testSwitchExpressionParsingAndExecution() {
        // Setup: Construct a JexlFeatures instance configured to allow ambiguous statements
        JexlFeatures jexl_features = JexlFeatures.createDefault();

        // Configure the JexlFeatures to allow ambiguous statements
        JexlFeatures configured_features = jexl_features.ambiguousStatement(true);

        // Build a JexlEngine with the configured features while disabling safe navigation and enabling strict mode
        JexlEngine jexl_engine = new JexlBuilder()
            .features(configured_features)
            .safe(false)
            .strict(true)
            .create();

        // Given: Prepare a source string representing a switch expression with multiple case branches and a default block containing local variable declarations
        String valid_source = "switch(input) { case 10; case 11: 3; case 20; case 21: 4; default: { var x = 40; x + 2; } }";

        // When: Invoke the script creation method on the engine, passing the source string and a parameter name string
        JexlScript compiled_script = jexl_engine.createScript(valid_source, "input");

        // Then: Assert that the returned script instance is not null
        assertNotNull(compiled_script, "Compiled script should not be null");

        // Retrieve the parsed text representation of the script
        String parsed_text = compiled_script.getParsedText();

        // Verify that the parsed text representation is not null
        assertNotNull(parsed_text, "Parsed text should not be null");

        // Execute the script with an integer input value of 10
        MapContext context10 = new MapContext();
        context10.set("input", 10);
        Object result_10 = compiled_script.execute(context10);

        // Confirm the result equals 3
        assertEquals(3, result_10, "Result for input 10 should be 3");

        // Execute the script with input 11
        MapContext context11 = new MapContext();
        context11.set("input", 11);
        Object result_11 = compiled_script.execute(context11);

        // Verify the result equals 3
        assertEquals(3, result_11, "Result for input 11 should be 3");

        // Execute the script with input 20
        MapContext context20 = new MapContext();
        context20.set("input", 20);
        Object result_20 = compiled_script.execute(context20);

        // Confirm the result equals 4
        assertEquals(4, result_20, "Result for input 20 should be 4");

        // Execute the script with input 21
        MapContext context21 = new MapContext();
        context21.set("input", 21);
        Object result_21 = compiled_script.execute(context21);

        // Verify the result equals 4
        assertEquals(4, result_21, "Result for input 21 should be 4");

        // Execute the script with input 38
        MapContext context38 = new MapContext();
        context38.set("input", 38);
        Object result_38 = compiled_script.execute(context38);

        // Validate that the default branch computation produces 42
        assertEquals(42, result_38, "Result for input 38 should be 42");

        // Given: Prepare a second source string containing a switch expression that attempts to use a break statement within a case branch
        String invalid_source = "switch(input) { case 10: break; default: 0 }";

        // When: Attempt to create a script from the malformed source within a try-catch block
        JexlScript invalid_script = null;
        Exception exception = null;
        try {
            invalid_script = jexl_engine.createScript(invalid_source, "input");
        } catch (Exception e) {
            exception = e;
        }

        // Then: If script creation succeeds, trigger a test failure indicating that break statements should not be permitted in switch expressions
        if (invalid_script != null) {
            fail("Break statements should not be permitted in switch expressions");
        }

        // Confirm that the exception message contains the term "break" to verify proper error reporting
        assertNotNull(exception, "Exception should be thrown for invalid switch expression");
        assertTrue(exception.getMessage().contains("break"), "Exception message should contain 'break'");

        // Assert that the script variable remains non-null after the exception handling completes
        assertNotNull(compiled_script, "Original compiled script should remain non-null");
    }
}

