package org.apache.commons.jexl3.internal;

import org.apache.commons.jexl3.JexlCache;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

import java.lang.reflect.Constructor;
import java.lang.reflect.Method;
import java.util.function.IntFunction;

public class MetaCacheTest {

    @Test
    public void testMetaCacheEvictionAndGarbageCollection() throws Exception {
        // Step 0: Instantiate a MetaCache configured with a concurrent cache factory
        // Using reflection to access the constructor since it's not public
        Constructor<MetaCache> constructor = MetaCache.class.getDeclaredConstructor(IntFunction.class);
        constructor.setAccessible(true);

        // Create a simple factory for testing
        IntFunction<JexlCache<?, ?>> factory = capacity -> new JexlCacheMock(capacity);
        MetaCache metaCache = constructor.newInstance(factory);

        // Step 1: Create first cache with capacity of 3 integer-to-string mappings
        // Using reflection since createCache is package-private
        Method createCacheMethod = MetaCache.class.getDeclaredMethod("createCache", int.class);
        createCacheMethod.setAccessible(true);
        JexlCache<Integer, String> firstCache = (JexlCache<Integer, String>) createCacheMethod.invoke(metaCache, 3);

        // Steps 2-4: Populate first cache with three entries (1->"one", 2->"two", 3->"three")
        firstCache.put(1, "one");
        firstCache.put(2, "two");
        firstCache.put(3, "three");

        // Step 5: Verify first cache size matches capacity (3)
        assertEquals(3, firstCache.size(), "First cache size should be 3");

        // Steps 6-8: Confirm all three entries are retrievable by their keys
        assertEquals("one", firstCache.get(1), "Entry with key 1 should return 'one'");
        assertEquals("two", firstCache.get(2), "Entry with key 2 should return 'two'");
        assertEquals("three", firstCache.get(3), "Entry with key 3 should return 'three'");

        // Step 9: Insert fourth entry (4->"four") to trigger eviction
        firstCache.put(4, "four");

        // Step 10: Validate first cache maintains size limit of 3
        assertEquals(3, firstCache.size(), "First cache size should remain at 3 after eviction");

        // Step 11: Confirm first entry was evicted (returns null)
        assertNull(firstCache.get(1), "Entry with key 1 should have been evicted");

        // Steps 12-14: Verify remaining entries are still accessible (keys 2, 3, 4)
        assertEquals("two", firstCache.get(2), "Entry with key 2 should still be accessible");
        assertEquals("three", firstCache.get(3), "Entry with key 3 should still be accessible");
        assertEquals("four", firstCache.get(4), "Entry with key 4 should be accessible");

        // Step 15: Create second cache with capacity of 2 string-to-string mappings
        JexlCache<String, String> secondCache = (JexlCache<String, String>) createCacheMethod.invoke(metaCache, 2);

        // Steps 16-17: Populate second cache with two entries ("a"->"alpha", "b"->"beta")
        secondCache.put("a", "alpha");
        secondCache.put("b", "beta");

        // Step 18: Confirm second cache size and retrievability of entries
        assertEquals(2, secondCache.size(), "Second cache size should be 2");

        // Steps 19-20: Confirm first entry in second cache is retrievable (key "a")
        assertEquals("alpha", secondCache.get("a"), "Entry with key 'a' should return 'alpha'");
        assertEquals("beta", secondCache.get("b"), "Entry with key 'b' should return 'beta'");

        // Step 21: Add third entry ("c"->"gamma") to second cache to force eviction
        secondCache.put("c", "gamma");

        // Step 22: Verify second cache size remains at 2
        assertEquals(2, secondCache.size(), "Second cache size should remain at 2 after eviction");

        // Step 23: Confirm first entry was evicted from second cache (key "a" returns null)
        assertNull(secondCache.get("a"), "Entry with key 'a' should have been evicted from second cache");

        // Steps 24-25: Validate remaining entries persist in second cache (keys "b", "c")
        assertEquals("beta", secondCache.get("b"), "Entry with key 'b' should persist in second cache");
        assertEquals("gamma", secondCache.get("c"), "Entry with key 'c' should persist in second cache");

        // Step 26: Verify MetaCache reports tracking exactly two cache instances
        Method sizeMethod = MetaCache.class.getDeclaredMethod("size");
        sizeMethod.setAccessible(true);
        assertEquals(2, sizeMethod.invoke(metaCache), "MetaCache should be tracking exactly two cache instances");

        // Step 27: Nullify both cache reference variables
        firstCache = null;
        secondCache = null;
        boolean firstCacheNull = (firstCache == null);
        boolean secondCacheNull = (secondCache == null);

        // Step 28: Assert both cache references are null
        assertTrue(firstCacheNull, "First cache reference should be null");
        assertTrue(secondCacheNull, "Second cache reference should be null");

        // Step 29: Trigger garbage collection explicitly
        System.gc();

        // Step 30: Enter polling loop to check MetaCache size up to five times
        int metaCacheSize = -1;
        for (int i = 0; i < 5; i++) {
            metaCacheSize = (Integer) sizeMethod.invoke(metaCache);
            if (metaCacheSize == 0) {
                break;
            }
            Thread.sleep(100); // Sleep briefly to allow GC to run
        }

        // Step 31: Assert MetaCache size has decreased to zero
        assertEquals(0, metaCacheSize, "MetaCache size should be zero after garbage collection");
    }

    // Simple mock implementation of JexlCache for testing purposes
    static class JexlCacheMock implements JexlCache {
        private final java.util.Map<Object, Object> map = new java.util.LinkedHashMap<>();
        private final int capacity;

        public JexlCacheMock(int capacity) {
            this.capacity = capacity;
        }

        @Override
        public Object put(Object key, Object value) {
            // Simple LRU eviction policy
            if (map.size() >= capacity && !map.containsKey(key)) {
                // Remove the first entry (simple FIFO eviction)
                Object firstKey = map.keySet().iterator().next();
                map.remove(firstKey);
            }
            return map.put(key, value);
        }

        @Override
        public Object get(Object key) {
            return map.get(key);
        }

        @Override
        public int size() {
            return map.size();
        }
    }
}

