package org.apache.commons.jexl3;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class ScriptComparisonTest {

    @Test
    public void testScriptEqualityAndHashCode() {
        // Step 0: Obtain a default JexlFeatures configuration
        JexlFeatures jexlFeatures = JexlFeatures.createDefault();

        // Create a JexlEngine instance
        JexlEngine jexlEngine = new JexlBuilder().create();

        // Step 1: Construct three Script instances where two share identical script text and one differs
        JexlScript source1 = jexlEngine.createScript(jexlFeatures, null, "x = 1;", (String[]) null);
        JexlScript source2 = jexlEngine.createScript(jexlFeatures, null, "x = 1;", (String[]) null);
        JexlScript source3 = jexlEngine.createScript(jexlFeatures, null, "x = 2;", (String[]) null);

        // Step 2: Verify that the first instance reports the correct text length
        String sourceText1 = ((org.apache.commons.jexl3.internal.Script) source1).getSourceText();
        assertEquals(6, sourceText1.length(), "Source text length should be 6 characters");

        // Step 3: Confirm that the two identical instances satisfy equality
        assertTrue(source1.equals(source2), "Identical scripts should be equal");

        // Step 4: Confirm that the two identical instances produce matching hash codes
        assertEquals(source1.hashCode(), source2.hashCode(), "Identical scripts should have the same hash code");

        // Step 5: Confirm that the differing instance fails equality with the first
        assertFalse(source1.equals(source3), "Different scripts should not be equal");

        // Step 6: Confirm that the differing instance produces a distinct hash code
        assertNotEquals(source1.hashCode(), source3.hashCode(), "Different scripts should have different hash codes");

        // Steps 7-12: Custom comparison logic using getSourceText() lexicographically
        String text1 = ((org.apache.commons.jexl3.internal.Script) source1).getSourceText();
        String text2 = ((org.apache.commons.jexl3.internal.Script) source2).getSourceText();
        String text3 = ((org.apache.commons.jexl3.internal.Script) source3).getSourceText();

        // Step 10: Validate that comparing the first instance to its identical counterpart yields zero
        int comparisonIdentical = text1.compareTo(text2);
        assertEquals(0, comparisonIdentical, "Comparing identical scripts should yield zero");

        // Step 11: Validate that comparing the first instance to the differing instance returns a negative value
        int comparisonDifferent = text1.compareTo(text3);
        assertTrue(comparisonDifferent < 0, "Comparing first script to different should return negative value");

        // Step 12: Validate that comparing in reverse order returns a positive value
        int comparisonReverse = text3.compareTo(text1);
        assertTrue(comparisonReverse > 0, "Comparing different script to first should return positive value");
    }
}

