        Source entry1 = new Source(features, emptyMap, "x + y");
        Source entry2 = new Source(features, emptyMap, "x + y");  // Identical to entry1
        Source entry3 = new Source(features, emptyMap, "x - y");  // Different from entry1

        // Additional entries for the second scenario
        Source entryA = new Source(features, emptyMap, "a * b");
        Source entryB = new Source(features, emptyMap, "a * b");  // Identical to entryA
        Source entryC = new Source(features, emptyMap, "a / b");  // Different from entryA

