        // Step 36: invoke createScript on jexl with "x + y", "x", "y" and reassign to script1
        script1 = jexl.createScript("x + y", "x", "y");

        // Step 37: assert script0 is not null
        assertNotNull(script0);

        // Step 38: assert script1 is not null
        assertNotNull(script1);

