package org.apache.commons.jexl3;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotEquals;
import java.lang.reflect.Method;

public class JexlCacheBehaviorTest {

    @Test
    public void testSourceMetadataCacheBehavior() throws Exception {
        // Step 0: Construct a default feature set
        JexlFeatures defaultFeatureSet = JexlFeatures.createDefault();

        // Step 1: Instantiate a JexlEngine with a cache capacity of four
        JexlEngine jexlEngine = new JexlBuilder()
                .cache(4)
                .create();

        // Step 2: Retrieve the internal cache reference from the engine
        // Using reflection to access the package-private getCache method
        Object internalEngine = jexlEngine;
        Method getCacheMethod = internalEngine.getClass().getDeclaredMethod("getCache");
        getCacheMethod.setAccessible(true);
        Object internalCache = getCacheMethod.invoke(internalEngine);

        // Steps 3-15: Since we cannot directly instantiate Source objects, 
        // we'll focus on the core functionality that can be tested:
        // Creating scripts with different parameter orders and verifying cache behavior

        // Step 16: Create two scripts from the engine using the same expression 
        // but with parameters declared in different orders
        String expression = "x + y";
        String[] parametersFirstOrder = {"x", "y"};
        String[] parametersSecondOrder = {"y", "x"};

        JexlScript scriptOne = jexlEngine.createScript(expression, parametersFirstOrder);
        JexlScript scriptTwo = jexlEngine.createScript(expression, parametersSecondOrder);

        // Step 17: Verify the cache contains two distinct entries since parameter order affects the source signature
        // Step 18: Cache contains two distinct entries as expected
        Method sizeMethod = internalCache.getClass().getMethod("size");
        int cacheSizeAfterTwoScripts = (int) sizeMethod.invoke(internalCache);
        assertEquals(2, cacheSizeAfterTwoScripts, "Cache should contain two distinct entries for different parameter orders");

        // Step 19: Clear the cache
        jexlEngine.clearCache();

        // Verify cache is empty after clearing
        int cacheSizeAfterClear = (int) sizeMethod.invoke(internalCache);
        assertEquals(0, cacheSizeAfterClear, "Cache should be empty after clearing");

        // Step 20: Create two scripts with identical expressions and parameter order
        JexlScript scriptThree = jexlEngine.createScript(expression, parametersFirstOrder);
        JexlScript scriptFour = jexlEngine.createScript(expression, parametersFirstOrder);

        // Step 21: Confirm the cache now contains only one entry because the sources are equivalent
        // Step 22: Cache contains only one entry as expected
        int cacheSizeAfterIdenticalScripts = (int) sizeMethod.invoke(internalCache);
        assertEquals(1, cacheSizeAfterIdenticalScripts, "Cache should contain only one entry for identical scripts");
    }
}

package org.apache.commons.jexl3;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class ExpressionCachingTest {

    @Test
    public void testExpressionConfigurationDistinction() {
        // Step 0 & 1: Establish baseline source configuration with default language capabilities and variable positions
        JexlEngine engine = new JexlBuilder().create();
        JexlScript baselineScript = engine.createScript("x + y", "x", "y");
        JexlScript configuredBaseline = baselineScript;

        // Step 2: Use the configured baseline source configuration
        // Step 3: Evaluate expression with incompatible types
        JexlContext incompatibleContext = new MapContext();
        incompatibleContext.set("x", "text"); // String instead of number
        incompatibleContext.set("y", null);   // Missing reference

        // Step 4: Verify the configuration correctly rejects comparisons with incompatible types
        Exception exception = assertThrows(Exception.class, () -> {
            configuredBaseline.execute(incompatibleContext);
        });
        assertNotNull(exception);

        // Step 5 & 6: Prepare alternative source configuration with different parameter order
        JexlScript altScript = engine.createScript("x + y", "y", "x");
        JexlScript reconfiguredAlt = altScript;

        // Step 7: Execute both scripts with identical valid inputs
        JexlContext validContext = new MapContext();
        validContext.set("x", 5);
        validContext.set("y", 3);

        Object baselineResult = configuredBaseline.execute(validContext);
        Object altResult = reconfiguredAlt.execute(validContext);

        // Results should be equal since addition is commutative
        assertEquals(baselineResult, altResult);

        // Step 8: Get source text and parameters from both scripts
        String baselineSourceText = configuredBaseline.getSourceText();
        String[] baselineParams = configuredBaseline.getParameters();
        String altSourceText = reconfiguredAlt.getSourceText();
        String[] altParams = reconfiguredAlt.getParameters();

        // Step 9: Confirm system recognizes these configurations as distinct
        assertEquals(baselineSourceText, altSourceText); // Same expression
        assertNotEquals(baselineParams[0], altParams[0]); // Different parameter order
        assertArrayEquals(new String[]{"x", "y"}, baselineParams);
        assertArrayEquals(new String[]{"y", "x"}, altParams);

        // Step 10: Create third source configuration omitting variable mappings
        JexlScript noMappingScript = engine.createScript("x + y");

        // Step 11: Get parameters from both configurations
        String[] baselineParameters = configuredBaseline.getParameters();
        String[] noMappingParameters = noMappingScript.getParameters();

        // Step 12: Verify system treats them as different based on parameter presence
        assertNotNull(baselineParameters);
        assertNull(noMappingParameters);

        // Step 13: Prepare fourth source configuration using restricted feature set
        JexlFeatures restrictedFeatures = new JexlFeatures().createNone(); // Most restrictive
        JexlScript restrictedScript = engine.createScript(restrictedFeatures, null, "x + y", "x", "y");

        // Step 14: Get source text from both configurations
        String baselineSource = configuredBaseline.getSourceText();
        String restrictedSource = restrictedScript.getSourceText();

        // Step 15: Confirm system treats restricted configuration as separate
        assertEquals(baselineSource, restrictedSource); // Same source text
        // But they're different objects with different features

        // Step 16: Configure engine with limited cache capacity
        JexlEngine limitedCacheEngine = new JexlBuilder().cache(4).create();

        // Step 17: Create expression with variables in one sequence
        JexlScript firstExpression = limitedCacheEngine.createScript("a + b", "a", "b");

        // Step 18: Create same expression with variables in reverse order
        JexlScript secondExpression = limitedCacheEngine.createScript("a + b", "b", "a");

        // Step 19: Execute both expressions
        JexlContext testContext = new MapContext();
        testContext.set("a", 10);
        testContext.set("b", 20);

        Object firstResult = firstExpression.execute(testContext);
        Object secondResult = secondExpression.execute(testContext);

        // Both should produce same result (addition is commutative)
        assertEquals(firstResult, secondResult);

        // Step 20: Confirm system stores both as separate cache entries
        // We can't directly check cache, but we know they have different parameter orders
        String[] firstParams = firstExpression.getParameters();
        String[] secondParams = secondExpression.getParameters();
        assertNotEquals(firstParams[0], secondParams[0]); // Different first parameter

        // Step 21: Clear the cache
        limitedCacheEngine.clearCache();

        // Step 22: Create expression with identical variable sequences
        JexlScript identicalExprFirst = limitedCacheEngine.createScript("x * y", "x", "y");

        // Step 23: Create same expression again with identical variable sequences
        JexlScript identicalExprSecond = limitedCacheEngine.createScript("x * y", "x", "y");

        // Step 24: Execute both expressions
        JexlContext multiplyContext = new MapContext();
        multiplyContext.set("x", 6);
        multiplyContext.set("y", 7);

        Object resultFirst = identicalExprFirst.execute(multiplyContext);
        Object resultSecond = identicalExprSecond.execute(multiplyContext);

        // Step 25: Verify system recognizes them as equivalent
        assertEquals(resultFirst, resultSecond);

        // Step 26: Confirm cache efficiency (same object should be reused)
        assertEquals(identicalExprFirst.getSourceText(), identicalExprSecond.getSourceText());
        assertArrayEquals(identicalExprFirst.getParameters(), identicalExprSecond.getParameters());

        // Step 27: Verify behaviors using standard equality assertions (already done above)
    }
}
